import React, { Component } from 'react'
import {AdminConsumer} from '../contexts/adminContext'


export class index extends Component {
    

    render() {
        return (
            <AdminConsumer>
                {
                    ({isValid, admin}) => {
                        return (
                            <div className="center">
                                <hr/>
                            </div>
                        )
                    }
                }
            </AdminConsumer>
        )
    }
}

export default index
